import { Component, Vue } from 'vue-property-decorator'
import books from '@/components/books.vue'
// The @Component decorator indicates the class is a Vue component
/* eslint-disable */
export default Vue.extend({
  name: 'Home',
  components: {
    books
  }
})
// @Component({
